import React from "react";
import Form from "react-bootstrap/Form";

export default function Search() {
  return (
    <div className='search'>
      <Form>
        <Form.Group>
          <Form.Control type='text' placeholder='Search a word' />
        </Form.Group>
      </Form>
    </div>
  );
}
